import React, { useState } from 'react'
import ChildDataEmployee from './ChildDataEmployee'

const GetData =(props)=>{
    const data=[
        { firstName: 'pasya', lastName: 'Sholeh', pekerjaan: 'Web Developer', status: 'Married' },
        { firstName: 'john', lastName: 'doe', pekerjaan: 'Web Developer', status: 'Married' },
        { firstName: 'jane', lastName: 'doe', pekerjaan: 'Designer', status: 'Single' }
      ]
      
      const [DataEmployee]=useState(data)
    return (
        <div>
         (ChildDataEmployee data=(DataEmployee))
        </div>

    )
}
export default GetData
